  `gender` tinyint(2) NULL DEFAULT NULL COMMENT '性别',
  `birthday` datetime(0) NULL DEFAULT NULL COMMENT '出生日期',
  `work_years` int(11) NULL DEFAULT NULL COMMENT '工作年限',
  `education` tinyint(4) NULL DEFAULT NULL COMMENT '最高学历',
