DROP TABLE IF EXISTS `single_page_comment`;
CREATE TABLE `single_page_comment`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `pid` int(11) UNSIGNED NULL DEFAULT NULL COMMENT '回复的评论ID',
  `page_id` int(11) UNSIGNED NULL DEFAULT NULL COMMENT '评论的内容ID',
  `user_id` int(11) UNSIGNED NULL DEFAULT NULL COMMENT '评论的用户ID',
  `author` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '评论的作者',
  `email` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '邮箱',
  `wechat` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '微信号',
  `qq` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'qq号',
  `content` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '评论的内容',
  `reply_count` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '评论的回复数量',
  `order_number` int(11) NULL DEFAULT 0 COMMENT '排序编号，常用语置顶等',
  `vote_up` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '“顶”的数量',
  `vote_down` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '“踩”的数量',
  `status` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '评论的状态',
  `created` datetime(0) NULL DEFAULT NULL COMMENT '评论的时间',
  `site_id` int(11) UNSIGNED NULL DEFAULT NULL COMMENT '站点ID',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `page_id`(`page_id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '页面评论表' ROW_FORMAT = Compact;

